commit_list.message:
Fixed a problem in TestContainerUpdate#testFailedUpdateOnOneNode behaving differently when key RulesManager.RULES_VERSION was owned by the failing node or not.
Infinispann/JDG calls the Listners in different way (in presence of failure in listners) if the failing node is the one owning the key or the oter way around;
is not a problem in real use of them since the resulting behaviour is the desired one but this present some challenges for testing.
